import Home from './Home.js';
import './App.css';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/"element={<Home/>}></Route>
        <Route path="/filter"element={<Filter/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
